import "./Heap.sol";

pragma experimental ABIEncoderV2;

contract HeapClient{
    using Heap for Heap.Data;
    Heap.Data public data;
    uint[] r;

    function heapify(uint128[] priorities) public {
        data.heapify(priorities);
    }
    function push(uint128 priority) public returns(Heap.Node){
        return data.push(priority);
    }
    function pop() public returns(Heap.Node){
        return data.pop();
    }
    function remove(uint128 id) public returns(Heap.Node){
        return data.remove(id);
    }
    function get() public view returns(Heap.Node[]){
        return data.get();
    }
    function getById(uint128 id) public view returns(Heap.Node){
        return data.getById(id);
    }
    function max() public view returns(Heap.Node){
        return data.max();
    }
    function size() public view returns(uint){
        return data.size();
    }
    function getByIndex(uint i) public view returns(Heap.Node){
        return data.getByIndex(i);
    }
    function idCount() public view returns(uint){
        return data.idCount;
    }
    function indices(uint128 id) public view returns(uint){
        return data.indices[id];
    }

}
